import s from './StyleLaterSeen/LaterSeen.module.css'


const LastSeen = (props) => {
    return (
        <div className={s.content}>
            {props.item.item.name}
            {props.item.map(u => <div key={u.id}>
                <div>{u.name}</div>
                <div>{u.cost}</div>
                <div>{u.structure}</div>


            </div>)
            }
        </div>
    )
}
export default LastSeen
